import { useEffect, useState } from "react";
import { useSelector } from "react-redux";
import { RootState } from "../../redux/store/store";
import { api } from "../../util/api";
import { styled } from "styled-components";
import { ApiStackData } from "../../type/aboutRedux";

export default function FolderOfStack() {
  const [apiStack, setApiStack] = useState<ApiStackData[]|boolean>();
  const stack = useSelector((state: RootState) => state.stack.stack);

  useEffect(() => {
    const dataOfStack = api.get("");
    setApiStack(false);
  }, [stack]);  

  if (!apiStack) return <NoneData>데이터가 없습니다.</NoneData>;

  return <div>FolderOfStack</div>;
}

const Container = styled.div`
  width: 100%;
  display: grid;
`


const NoneData = styled.div`
  color: white;
  font-size: 30px;
`
